module.exports = "<div class=\"dialog-wrapper\">\n    <div class=\"dialog-header\">\n        <h3 i18n=\"@@instructions\">Instructions</h3>\n    </div>\n    <div class=\"dialog-content\" i18n=\"@@harmonizer-instructions\">\n        <h4> Background </h4>\n        <p> Species names change over time and they can vary between different taxonomies. For these reasons, we ask that you match the scientific names in your dataset to a current, valid taxonomy in Map of Life, a process called taxonomic harmonization. This allows Map of Life to accurately group all data for a single species (i.e., taxonomic concept), which is critical for informing data analyses and visualizing all species records on a single map. The Map of Life database has several taxonomies to choose from, and the harmonization tool allows you to quickly identify typos, synonyms, and invalid names, and suggests valid names. Note that all original scientific name entries are archived, but if a name remains unmatched after finalizing the dataset, the records associated with that name will not be visualized on Map of Life or other platforms supported by Map of Life. </p>\n        <p>The harmonizer will automatically check the scientific names in your dataset for exact matches in the available taxonomies for that taxonomic group. Once this step is complete, you can choose a taxonomy that best represents the taxonomic concepts used in your dataset. When you accept the taxonomy, we will provide suggestions for any names that do not have an exact match using a fuzzy search and querying our list of synonyms for that taxonomic group. You will then have the opportunity to select the correct name from the options provided or type in a new name. Because this verification process may take time, you can save your progress and come back to this step as needed. Once you have verified all the names in your dataset, your dataset will be complete and, if you have made your dataset public, will show up on Map of Life and other platforms supported by Map of Life.</p>\n\n        <h4>Selecting a Taxonomy</h4>\n        <p>Please select the taxonomy that best matches the taxonomic concepts used in your dataset. In addition to official taxonomies for a particular taxonomic group, we also provide the option to use the <a href=\"https://www.gbif.org/dataset/d7dddbf4-2cf0-4f39-9b2a-bb099caae36c\">GBIF Backbone Taxonomy</a>, a compilation of over 50 taxonomies covering all taxonomic groups. You can change the taxonomy at any time, but you will need to start the verification process over again. Use the Accept button to look for potential matches for names without an exact match.</p>\n\n        <h4>Names to Verify</h4>\n        <p>After you have selected a taxonomy, species that do not have an exact name match to your chosen taxonomy will appear in the left column. These are the names that we ask you to verify. We will automatically look for fuzzy matches to catch spelling errors and search our list of synonyms. Any results from this search will appear in the drop-down menu for each species. The best match will be automatically selected and a number will appear in square brackets after the name that indicates how many possible matches we found. There are several ways of verifying names. Here are 2 methods for verifying your names:</p>\n\n        <h5>Successful match from approximate name search</h5>\n        <p>The example below is for a bird species using the Clements taxonomy. Our approximate search found 7 matches for the name Alethe poliocephala. Once you determine that the current recognized name for this species is Pseudoalethe poliocephala, select it from the list of possible names. Your verified name will appear after an arrow indicating that the original name will be mapped to the name you have chosen. Once you have completed verifying a species, make sure that the checkbox is selected and use the arrow button in the middle of the screen to move it over to the right-hand column of verified names.</p>\n        <img src=\"https://mapoflife.github.io/upload-dev/assets/img/harmonizer_partial_1.png\">\n\n        <h5>Unsuccessful match from approximate name search</h5>\n        <p>In some cases, we will not find any possible name matches. In this situation, you can keep the original name from your uploaded file, or you can type in a different name. If you type in a new name, you can check that that name is in your chosen taxonomy by selecting the re-check button that will appear once you’ve typed a name. In the example below, no possible matches were found for the species Andropadus ansorgei. A quick Google search reveals that the species name has changed to Eurillas ansorgei. Type the name in the space provided and a button will appear allowing you to check the new name against the taxonomy. This re-check process confirms that Eurillas ansorgei is in the selected taxonomy as indicated by the single match listed in square brackets and the name you typed now appearing in the drop-down menu. You can now make sure that the check box is selected and move the name to the verified names column. If the name you typed is not in the taxonomy, it will still appear with zero matches as it was originally listed. In this case, you can type in a different name or keep the original name.</p>\n        <img src=\"https://mapoflife.github.io/upload-dev/assets/img/harmonizer_partial_2.png\">\n        <p class=\"text-muted\">No name matches were found for Andropadus ansorgei. After typing in the currently recognized name for the species, a button will appear allowing you to check the new name against the taxonomy.</p>\n        <img src=\"https://mapoflife.github.io/upload-dev/assets/img/harmonizer_partial_3.png\">\n        <p class=\"text-muted\">The new name was found in the taxonomy as indicated by the (1) after the name. You can now select the box next to the species and move it to the verified column.</p>\n\n        <h4>Verified Names</h4>\n        <p>Species names in your dataset with an exact match in the chosen taxonomy will automatically be displayed in this column. If you decide that a name is incorrect for any reason, you can use the check box to the left of the name to move it to the left-hand column and make corrections. This may occur if the species concept was split and your data reflects what is now considered a different species.</p>\n        <p>Once you have verified a name, it will appear in the verified list as the original name followed by an arrow and the name that you have matched it to. If you realize you have made a mistake, you can use the check box to move the species name to the left-hand column and edit it there.</p>\n        <p>If you do not find a match in the taxonomy for a species, you can keep the original name. These unmatched names are indicated with <strong>*unmatched</strong> appearing to the right of the name. Records for unmatched species will not appear on Map of Life platforms, but will still be stored in the database.</p>\n\n        <h4>How to Search for Accepted Names in a Taxonomy</h4>\n        <p>There are a number of online resources available to help you search for the currently recognized name according to a particular taxonomy. The best option is to look at the complete list of species in the taxonomy you have chosen. Links to some of the taxonomies we support are provided below. In addition to these, you can also try more general searches on sites that compile accepted names and synonyms for all taxa.</p>\n\n        <ul>\n            <li>\n                Amphibians\n                <ul>\n                    <li><a href=\"http://research.amnh.org/vz/herpetology/amphibia/\">Amphibian Species of the World v 6.0 (Frost)</a></li>\n                    <li><a href=\"https://amphibiaweb.org/\">AmphibiaWeb</a></li>\n                </ul>\n            </li>\n            <li>\n                Birds\n                <ul>\n                    <li><a href=\"http://datazone.birdlife.org/species/taxonomy\">BirdLife</a></li>\n                    <li><a href=\"https://birdtree.org/\">BirdTree (Jetz)</a></li>\n                    <li><a href=\"http://www.birds.cornell.edu/clementschecklist/download/\">Clements/eBird</a></li>\n                </ul>\n            </li>\n            <li>\n                Fish\n                <ul>\n                    <li><a href=\"http://researcharchive.calacademy.org/research/ichthyology/catalog/fishcatmain.asp\">Catalog of Fishes</a></li>\n                    <li><a href=\"http://www.fishbase.org/search.php\">FishBase</a></li>\n                </ul>\n            </li>\n            <li>\n                Mammals\n                <ul>\n                    <li><a href=\"https://mammaldiversity.org/\">Mammal Diversity Database</a></li>\n                    <li><a href=\"http://www.departments.bucknell.edu/biology/resources/msw3/\">Mammal Species of the World v 3</a></li>\n                </ul>\n            </li>\n            <li>\n                Reptiles\n                <ul>\n                    <li><a href=\"http://www.reptile-database.org\">Reptile Database</a></li>\n                </ul>\n            </li>\n            <li>\n                Plants\n                <ul>\n                    <li><a href=\"http://www.theplantlist.org/\">The Plant List</a></li>\n                </ul>\n            </li>\n            <li>\n                All Taxa\n                <ul>\n                    <li><a href=\"http://www.catalogueoflife.org/col/search/scientific\">Catalog of Life</a></li>\n                    <li><a href=\"https://www.gbif.org/dataset/d7dddbf4-2cf0-4f39-9b2a-bb099caae36c\">Global Biodiversity Information Facility (GBIF)</a></li>\n                    <li><a href=\"https://www.itis.gov\">Integrated Taxonomic Information System (ITIS)</a></li>\n                    <li><a href=\"https://www.iucnredlist.org\">International Union for Conservation of Nature (IUCN)</a></li>\n                    <li><a href=\"http://ubio.org/index.php?pagename=namebank\">uBio - NameBank</a></li>\n                    <li><a href=\"https://en.wikipedia.org/wiki/Main_Page\">Wikipedia</a></li>\n                </ul>\n            </li>\n        </ul>\n\n    </div>\n    <div class=\"dialog-footer\">\n        <button mat-button class=\"mol-button primary basic\" (click)=\"onCloseClick()\">Close</button>\n    </div>\n</div>\n"

