module.exports = "<p> The uploader tool is designed to help you easily import, visualize, and share your biodiversity datasets, while adhering to universal data standards. It also provides data permissions and licensing options, and includes a taxonomic harmonization tool. Bellow you will find detailed information on how to prepare and load your datasets.</p>\n<p><u>What is a taxonomic group? </u></p>\n<p> The Map of Life platform consists of a set list of taxonomic groups. Some of these groups are nested within others (e.g., Turtles are nested within Reptiles), while other groups are not yet complete in the database (e.g., Plants (selection)). As more taxonomies and range maps are added to the Map of Life database, these groups will become more refined.\n </p>\n<div class=\"flex-list\">\n  <div>\n    <ul class=\"fa-ul\">\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Birds</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Mammals</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Amphibians</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Reptiles</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Turtles (non-marine)</li>\n    </ul>\n  </div>\n  <div>\n    <ul class=\"fa-ul\">\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Butterflies</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Sphingid Moths</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Bumblebees</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Dragonflies</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Fishes</li>\n    </ul>\n  </div>\n  <div>\n    <ul class=\"fa-ul\">\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Plants (selection)</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Trees</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Cacti</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Conifers</li>\n      <li><span class=\"fa-li\"><i class=\"fa fa-check\"></i></span>Palms</li>\n    </ul>\n  </div>\n</div>\n<p><u>Dataset Type</u></p>\n<ol>\n  <li><strong>Occurrences:</strong> A list of species of defined taxonomic scope (e.g., mammals, raptors, etc.) with spatial coordinates and a date for each observation. </li>\n  <li><strong>Inventories:</strong>A list of species of defined taxonomic scope (e.g. mammals, raptors, etc.) that occur in a defined area delineated by a polygon (e.g., a national park or nature reserve). Note that it is possible to upload a single dataset with inventories for different regions/polygons, as long as the values in the region_id field match in the CSV and SHP files (see Data Preparation).</li>\n</ol>\n<p><u>Data Preparation</u></p>\n<p>The Map of Life database follows the Darwin Core and Humboldt Core standards. Please align your fields according to the following instructions. Not following these instructions may cause your upload to fail. It is important to note that capitalization and spacing matter in formatting both the CSV and SHP files. Additional fields can be included, preferably with the field names in <a href=\"https://en.wikipedia.org/wiki/Camel_case\">lower camel case</a>. Data preparation steps vary depending on the dataset type. </p>\n<ol>\n  <li> Occurrences:\n    <ul>\n      <li> <em>Table Format.</em> Format columns (column header) to match the required fields below. The file must be saved in CSV format.\n        <ol>\n          <li><em>scientificname:</em> The scientific name of the species. This field must be a binomial (Genus species; e.g. ‘Branta canadensis’). If you wish to record subspecies level information, it should be included as a separate column.\n            <li><em>decimal_latitude:</em> Latitude in decimal degrees.</li>\n            <li><em>decimal_longitude:</em> Longitude in decimal degrees.</li>\n            <li><em>date:</em> Observation Date in ISO 8601 format (most commonly yyyy-mm-dd).</li>\n            <li><em>recorded_by:</em> Oberserver’s name.</li>\n        </ol>\n        </li>\n        <li> <em>Metadata.</em> Specific information that describes your dataset. Please provide as much information as possible, as it can be used to quickly identify and evaluate your dataset. The minimum required fields consist of:\n          <ol>\n            <li><em>Title of the dataset</em></li>\n            <li><em>Permissions (see Permissions)</em></li>\n            <li><em>License (see License)</em></li>\n            <li><em>Release Date (see Release Date)</em></li>\n          </ol>\n        </li>\n    </ul>\n    </li>\n    <li> Inventories:\n      <ul>\n        <li> <em>Table Format.</em> Format columns (column header) to match the required fields below. The file must be saved in CSV format.\n          <ol>\n            <li><em>scientificname:</em> The scientific name of the species. This field must be a binomial (Genus species; e.g. ‘Branta canadensis’). If you wish to record subspecies level information, it should be included as a separate column.</li>\n            <li><em>region_id:</em> This field will match the location of the species to the respective polygon(s) uploaded with this dataset. The region_id values in the CSV and the attribute table of the SHP file should match.</li>\n          </ol>\n        </li>\n        <li> <em>Shape File.</em> A zipped folder of the study area polygon(s) that contains all the necessary files (.shp, .dbf, .prj, .qpj, and .shx). The study area polygon(s) is the area with which the inventory is associated. If there are multiple polygon features, each feature should have a unique region_id in the attribute table that matches the region_id for that observation in the CSV. If there is a single study area, the region_id can be set to ‘1’ or ‘locationA’ in the SHP file and CSV. </li>\n        <li> <em>Metadata.</em>  Specific information that describes your dataset. Please provide as much information as possible, as it can be used to quickly identify and evaluate your dataset. The minimum required fields consist of:\n          <ol>\n            <li><em>Title of the dataset</em></li>\n            <li><em>Permissions</em> (see Permissions)</li>\n            <li><em>License</em> (see License)</li>\n            <li><em>Release Date</em> (see Release Date)</li>\n            <li><em>Survey start and end date.</em> The date the survey began and the last day of the survey.</li>\n            <li><em>Completeness:</em> Indicate how well the list of species in the inventory reflects the species in the study area. Does the inventory capture 0-25%, 25-50%, 50-75%, or 75-100% of the species within the taxonomic scope of the study?</li>\n          </ol>\n        </li>\n      </ul>\n    </li>\n</ol>\n<p><u>Permissions</u></p>\n<p> There are three types of permissions you can assign to a dataset. You can select all three options, or none. To make a dataset ‘Public’, you select ‘Allow public visualization’. A dataset is ‘Private’ only if at least the ‘Allow public visualization’ tick box is <u>un</u>selected. To make a dataset ‘Private’, at minimum ‘Allow public visualization’ should be unselected. If you do not select public visualization or download, you will be prompted to provide a release date.\n</p>\n<ul>\n  <li><strong>Allow public visualization.</strong> Allow the dataset to be displayed on Map of Life and platforms supported by Map of Life. </li>\n  <li><strong>Allow MOL modeling use.</strong> Allow Map of Life and its associated partners (e.g., <a href=\"http://www.gmba.unibe.ch/\">Global Mountain Biodiversity Assessment</a>) to use the dataset in spatial analyses and modeling.</li>\n  <li><strong>Allow public download.</strong> Allow other registered Map of Life users to download the dataset.</li>\n</ul>\n<p><u>License</u></p>\n<p>\n  If your dataset is made Public, you will have to specify the data license, for which different data uses are specified. Three Creative Commons licensing options are currently offered:\n</p>\n  <ul>\n    <li><a href=\"https://creativecommons.org/publicdomain/mark/1.0/\">CC0</a>: This license waives copyright of the dataset and, as much as is allowable by law, places the dataset in the public domain.</li>\n    <li><a href=\"https://creativecommons.org/licenses/by/3.0/\">CC-BY</a>: This license means that users may copy, distribute, and make derivative works only if they give credit to the author or licensor (attribution).</li>\n    <li><a href=\"https://creativecommons.org/licenses/by-nc/2.0/\">CC-BY-NC</a>: This license indicates that users may copy, distribute, and make derivative works (see CC-BY above), while attribute the author and for non-commercial use only.</li>\n  </ul>\n<p><u>Release Policy</u></p>\n<ul>\n  <li><strong>Set full release date.</strong> If you are not ready to immediately allow public visualization, modeling, or download of your dataset, we ask that you provide a release date. On the date you select, all permissions (visualization, modeling, and download) will be allowed. The full release will occur at 00:00 GMT on the day you select.</li>\n  <li><strong>Don’t set release date.</strong> If your work is still in <em>prep</em> and you cannot commit to a release date, you can select this option and we will send you an email reminder every 6 months.</li>\n</ul>\n<p><u>Taxonomic Harmonization</u></p>\n<p>Because species names can change over time and vary between different taxonomic authorities, matching the names in your dataset to a current, valid taxonomy is critical for the representation of all records of a species on one map. The Map of Life database has several taxonomies to choose from, and the harmonization tool allows you to quickly identify mismatched information and typos, and suggests valid names. Note that all original scientific name entries are archived, but if a name remains unmatched after finalizing the dataset, the records associated with that name will not be visualized on Map of Life or other platforms supported by Map of Life.</p>\n"

