module.exports = "<mat-card>\n  <mat-card-header>\n    <mat-card-title>\n      <h2>\n        <span i18n=\"@@completeness\">Completeness</span>\n        <mol-help-info i18n-tooltip=\"@@metadata-sections:completeness:completeness-tooltip\" tooltip=\"Assess the representativeness of the species list for the study area and taxonomic scope. For example, were all of the amphibians in the study area recorded, or does the inventory only reflect half of the amphibians present? Completeness can be inferred from survey effort and methods and can be assessed using the length and timing of the study, spatial extent of sampling, inclusion of all habitats present in study area, expertise of individuals conducting the inventory, and/or species accumulation curves.\"></mol-help-info>\n        <span class=\"required\" i18n=\"@@required\">required</span>\n      </h2>\n    </mat-card-title>\n  </mat-card-header>\n\n\n  <div class=\"two-controls\">\n\n    <!-- Material design is currently broken (Nov. 2017) the label is a hack around -->\n    <div class=\"left input-container\">\n      <label *ngIf=\"!metadataService.inv_completeness_optout\">\n        <span i18n=\"@@metadata-sections:completeness:lower-bound-title\">Lower bound</span>\n        <mol-help-info i18n-tooltip=\"@@metadata-sections:completeness:lower-bound-tooltip\" tooltip=\"Inferred completeness is captured in quartiles (i.e., 0, 25, 50, 75). Indicate the lower bound of completeness percentage for the study. For example, if you believe the inventory represents 25-50% of the species present in the area, indicate a value of 25 for the lower bound.\"></mol-help-info>\n         <span class=\"required\" i18n=\"@@required\">required</span>\n      </label>\n      <mat-select\n          *ngIf=\"!metadataService.inv_completeness_optout\"\n          [@toggleNgIf]\n          [(ngModel)]=\"metadataService.inv_completeness_lower\"\n          required>\n        <mat-option value=\"0\">0%</mat-option>\n        <mat-option value=\"25\">25%</mat-option>\n        <mat-option value=\"50\">50%</mat-option>\n        <mat-option value=\"75\">75%</mat-option>\n      </mat-select>\n    </div>\n\n    <!-- Material design is currently broken (Nov. 2017) the label is a hack around -->\n    <div class=\"right input-container\">\n      <label *ngIf=\"!metadataService.inv_completeness_optout\">\n        <span i18n=\"@@metadata-sections:completeness:upper-bound-title\">Upper bound</span>\n        <mol-help-info i18n-tooltip=\"@@metadata-sections:completeness:upper-bound-tooltip\" tooltip=\"Inferred completeness is captured in quartiles (i.e., 25, 50, 75, 100). Indicate the upper bound of completeness percentage for the study. For example, if you believe the inventory represents 25-50% of the species present in the area, indicate a value of 50 for the upper bound.\"></mol-help-info>\n        <span class=\"required\" i18n=\"@@required\">required</span>\n      </label>\n      <mat-select\n          *ngIf=\"!metadataService.inv_completeness_optout\"\n          [@toggleNgIf]\n          [(ngModel)]=\"metadataService.inv_completeness_upper\"\n          required>\n        <mat-option value=\"25\">25%</mat-option>\n        <mat-option value=\"50\">50%</mat-option>\n        <mat-option value=\"75\">75%</mat-option>\n        <mat-option value=\"100\">100%</mat-option>\n      </mat-select>\n    </div>\n</div>\n\n  <mat-input-container *ngIf=\"!metadataService.inv_completeness_optout\" [@toggleNgIf]>\n    <label>\n      <span i18n=\"@@metadata-sections:completeness:rationale-title\">Rationale used to determine completeness</span>\n      <mol-help-info i18n-tooltip=\"@@metadata-sections:completeness:rationale-tooltip\" tooltip=\"Provide an explanation for your completeness score. Examples of high completeness: the surveyors used several different survey methods to inventory the target taxonomic group (i.e., Ungulates); the surveyors made great effort to survey each habitat type in the study area that a species from the target group would be found in; the authors utilized several resources such as museum specimens and primary literature to produce a complete inventory. Examples of low completeness: the study length was not appropriate for the size of the area; inappropriate or insufficient methods were used for the target group; the study area was difficult to traverse/hard to access.\"></mol-help-info>\n       <span class=\"required\" i18n=\"@@required\">required</span>\n    </label>\n    <textarea\n      matInput\n      [(ngModel)]=\"metadataService.inv_completeness_rationale\"\n      required>\n    </textarea>\n  </mat-input-container>\n\n  <div class=\"input-container margin\">\n    <mat-checkbox [(ngModel)]=\"metadataService.inv_completeness_optout\">\n      <span i18n=\"@@metadata-sections:completeness:opt-out-checkbox\">Opt out of specifying completeness</span>\n    </mat-checkbox>\n  </div>\n\n  <mat-input-container *ngIf=\"metadataService.inv_completeness_optout\" [@toggleNgIf]>\n    <label>\n      <span i18n=\"@@metadata-sections:completeness:reason-for-no-completeness\">Reason for not providing completeness info</span>\n      <span class=\"required\" i18n=\"@@required\">required</span>\n    </label>\n    <textarea\n      matInput\n      [(ngModel)]=\"metadataService.inv_completeness_optout_reason\" required>\n    </textarea>\n  </mat-input-container>\n\n\n</mat-card>\n"

