module.exports = " <mat-card>\n  <mat-card-header>\n    <mat-card-title>\n      <h2 i18n=\"@@methods\"> Methods </h2>\n    </mat-card-title>\n  </mat-card-header>\n\n  <!-- Material design is currently broken (Nov. 2017) the label is a hack around -->\n  <div class=\"input-container\">\n    <label>\n      <span i18n=\"@@metadata-sections:methods:inventories-compilations-both\">Inventories / Compilation / Both</span>\n      <mol-help-info i18n-tooltip=\"@@metadata-sections:methods:inventories-compilations-both-tooltip\" tooltip=\"Select the method used to compile the inventory. Selecting 'inventory' indicates that the species data consist of observations made by the surveyors, 'compilation' means that the authors compiled a species list using other sources (e.g., historical evidence, other publications), while 'both' means that both methods were used.\"></mol-help-info>\n    </label>\n    <mat-select class=\"mat-select-block\" [(ngModel)]=\"metadataService.inv_inventory_compilation_both\">\n      <mat-option value=\"inventories\" i18n=\"@@metadata-sections:methods:inventories-compilations-both:inventories-option\">Inventories</mat-option>\n      <mat-option value=\"compilation\" i18n=\"@@metadata-sections:methods:inventories-compilations-both:compilation-option\">Compilation</mat-option>\n      <mat-option value=\"both\" i18n=\"@@metadata-sections:methods:inventories-compilations-both:both-option\">Both</mat-option>\n    </mat-select>\n  </div>\n\n  <!-- Material design is currently broken (Nov. 2017) the label is a hack around -->\n  <div class=\"multi-select input-container\"\n      *ngIf=\"metadataService.inv_inventory_compilation_both == 'inventories' || metadataService.inv_inventory_compilation_both == 'both'\">\n    <label>\n      <span i18n=\"@@metadata-sections:methods:type-of-inventory\">Type of Inventory</span>\n    </label>\n    <mat-select i18n-placeholder=\"@@metadata-sections:methods:type-of-inventory\" placeholder=\"Type of inventory\" [(ngModel)]=\"metadataService.inv_inventory_type\" multiple>\n      <mat-option value=\"restricted\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-inventory:restricted\">Restricted</mat-option>\n      <mat-option value=\"open search\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-inventory:open-search\">Open search</mat-option>\n      <mat-option value=\"opportunistic search\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-inventory:opportunistic-search\">Opportunistic search</mat-option>\n      <mat-option value=\"trap\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-inventory:trap\">Trap</mat-option>\n      <mat-option value=\"adventitious\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-inventory:adventitious\">Adventitious</mat-option>\n      <mat-option value=\"incidental\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-inventory:incidental\">Incidental</mat-option>\n    </mat-select>\n    <mat-hint i18n=\"@@metadata-sections:methods:type-of-inventory:hint\">\n      If 'inventory' is selected above, select the type of inventory.\n      <br /> <b>Restricted Search</b> - Highly structured survey methods such as transects or plots.\n      <br /> <b>Open Search</b> - Less restrictive than restricted search. A particular search area is defined, but effort is presumed to be standardized across those areas; for example, ''We searched sites for a specific length of time proportional to the area.''\n      <br /> <b>Opportunistic Search</b> - A search such as that often performed in efforts such as eBird where a surveyor goes to an area and makes observations in an area that doesn't have a pre-defined shape and size, nor necessarily a clear effort measurement associated with it.\n      <br /> <b>Trap</b> - Stationary traps, camera traps, or nets were used.\n      <br /> <b>Adventitious</b> - Any survey data obtained from sources besides live sightings, such as scat, roadkill, specimens presented by hunters, or animals sold at markets.\n      <br /> <b>Incidental</b> - A casual search that happens with minimal effort such as reports of species observed while eating lunch or otherwise not actively looking. This may also refer to organisms which are outside the scope of the survey but which the authors specifically noted.'\n      <br />\n    </mat-hint>\n  </div>\n\n  <!-- Material design is currently broken (Nov. 2017) the label is a hack around -->\n  <div class=\"multi-select input-container\"\n      *ngIf=\"metadataService.inv_inventory_compilation_both == 'compilation' || metadataService.inv_inventory_compilation_both == 'both'\">\n    <label>\n      <span i18n=\"@@metadata-sections:methods:type-of-compilation\">Type of compilation</span>\n    </label>\n    <mat-select i18n-placeholder=\"@@metadata-sections:methods:type-of-compilation:placeholder\" placeholder=\"Type of compilation\" [(ngModel)]=\"metadataService.inv_compilation_type\" multiple>\n      <mat-option value=\"expert knowledge\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-compilation:expert-knowledge\">Expert knowledge</mat-option>\n      <mat-option value=\"primary literature\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-compilation:primary-literature\">Primary literature</mat-option>\n      <mat-option value=\"museum specimens\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-compilation:museum-specimens\">Museum specimens</mat-option>\n      <mat-option value=\"other\" class=\"multi-select\" i18n=\"@@metadata-sections:methods:type-of-compilation:other\">Other</mat-option>\n    </mat-select>\n    <mat-hint i18n=\"@@metadata-sections:methods:type-of-compilation:hint\">\n      Type of resources used to compile checklist.\n      <br /> <b> Expert knowledge </b> - park rangers or scientists are more reliable than villagers.\n      <br /> Unless the authors used a method to make sure the villagers knew the species in the area, i.e. vouchers or pictures, then we do not count villagers as expert knowledge.\n      <br /> <b> Primary literature </b> - information obtained from published sources\n      <br /> <b> Museum specimens </b> - museum records that were collected from the study area\n      <br />Other\n    </mat-hint>\n  </div>\n\n  <!-- Material design is currently broken (Nov. 2017) the label is a hack around -->\n  <div class=\"input-container\"\n      *ngIf=\"metadataService.inv_inventory_compilation_both == 'compilation' || metadataService.inv_inventory_compilation_both == 'both'\">\n    <label>\n      <span i18n=\"@@metadata-sections:methods:compilation-effort\">Compilation Effort</span>\n    </label>\n    <mat-select i18n-placeholder=\"@@metadata-sections:methods:compilation-effort:placeholder\" placeholder=\"Compilation effort\" [(ngModel)]=\"metadataService.inv_compilation_effort\">\n      <mat-option value=\"low\" i18n=\"@@low\">Low</mat-option>\n      <mat-option value=\"medium\" i18n=\"@@medium\">Medium</mat-option>\n      <mat-option value=\"high\" i18n=\"@@high\">High</mat-option>\n    </mat-select>\n  </div>\n\n  <mat-input-container>\n    <label>\n      <span i18n=\"@@metadata-sections:methods:survey-methods:title\">Survey Methods</span>\n      <mol-help-info i18n-tooltip=\"@@metadata-sections:methods:survey-methods:tooltip\" tooltip=\"Provide specific details about the survey methods, such as protocols followed, equipment used, number of transects or plots, etc.\"></mol-help-info>\n    </label>\n    <textarea matInput [(ngModel)]=\"metadataService.inv_survey_protocol1\"></textarea>\n  </mat-input-container>\n\n</mat-card>\n"

