module.exports = "<span i18n=\"@@quick-info\">\n  <p> The uploader tool is designed to help you easily import, visualize, and share your biodiversity datasets. The two types of datasets you can currently upload are:</p>\n  <ol>\n    <li>Occurrences, incidental records with spatial coordinates, and </li>\n    <li>Inventories, a checklist of species with an explicit spatial extent</li>\n  </ol>\n  <p> <em>\n      Disclaimer: Data imported through this uploader tool will be loaded into the Map of Life database, and if the data are made public (see Permissions in Detailed Instructions), it will be available across Map of Life and platforms supported by Map of Life (e.g. <a href=\"http://www.mountainbiodiversity.org/explore\">mountainbiodiversity.org</a>).\n  </em> </p>\n  <p> Follow these steps to upload your dataset. For more information, please see Detailed Instructions below.\n  </p>\n  <ol>\n    <li><strong>Select the taxonomic group</strong> from the list of available groups (e.g., birds, mammals, butterflies, etc.). If your data include different taxonomic groups, please prepare and upload separate datasets for each taxonomic group. </li>\n    <li><strong>Select the dataset type.</strong> (Occurrences/Inventory).</li>\n    <li><strong>Upload files.</strong> The upload requirements differ depending on the dataset type\n      <ul>\n        <li> Occurrences: CSV file </li>\n        <li> Inventory: CSV file and zipped geometry files (.shp, .shx, .prj, .dbf, .cpg) </li>\n      </ul>\n    </li>\n    <li><strong>Provide metadata.</strong> After uploading your data files, you will be prompted to fill out dataset-level information (e.g., Permissions, License, Dataset Title). There is a short list of required fields, and you can choose to provide more detailed metadata (e.g. Citation, Geographic Scope) to facilitate the search and increase the visibility of your dataset.</li>\n    <li><strong>Review dataset.</strong> View your dataset in the dataset overview page. Check the table summaries, map visualizations, and metadata.</li>\n    <li><strong>Finalize dataset.</strong> The final step is to taxonomically harmonize your species list. Select a recognized taxonomy and resolve any unmatched names.</li>\n    <li><strong>Share your dataset!</strong> Now you can visualize your dataset in detailed species maps and invite other users to view it through the permissions feature.</li>\n  </ol>\n</span>\n"

